    function mint(uint amount) 
        public 
        onlyOwner
    {
        /******* TODO: Implement this function *******/
        require(mint_active, "Minting is disabled");
        require(amount>0, "Amount mas be greater then 0");
        _mint(msg.sender, amount);
    }

